import React from "react";
import "./Navbar.scss";
export const Navbar = () => {
    return <div className="Navbar">
        <ul>
            <li>Trang chủ</li>
            <li>Sản phẩm</li>
            <li>Liên hệ</li>
        </ul>
    </div>
}
